import React from "react";

function Road(props) {
        return (
            <div
            className = {props.StylingInfo}
            style = {{
            height: props.height, 
            width: props.width,
            paddingRight: props.paddingRight,
            paddingLeft: props.paddingLeft} 
            }>
            </div>
        )
}

export default Road;
